import React from "react";
import ReviewList from "./review/ReviewList";

const Review = ({ isOpen, close }) => {
  return (
    <React.Fragment>
      {isOpen ? (
        <div align="center">
          <ReviewList />
        </div>
      ) : null}
    </React.Fragment>
  );
};
export default Review;
